Lonely Planet East Africa is your passport to the most relevant, up-to-date advice on what to see and skip, and what hidden discoveries await you.

Wander the winding backstreets of Lamu, trek to the top of Mount Kilimanjaro, or watch the annual wildebeest migration in Masai Mara; all with your trusted travel companion. Get to the heart of East Africa and begin your journey now!
